import React from 'react';
import '../App.css';
import MovieCards from './MovieCard';

class MovieList extends React.Component {
  render() {
    const { movieInfo } = this.props;
    return (
      <section>
        <MovieCards key={ movieInfo } movie={ movieInfo } />
      </section>
    );
  }
}

// MovieList.propTypes = {
